const makeWidget = (weatherInfo) => {

    function makeNodes(obj) {
        const nodeArr = [];
        for (let key in weatherInfo) {
            nodeArr.push(
                <div className={key}>
                    {weatherInfo[key]}
                </div>
            )
        }
        return nodeArr.map((item, index) => {
            return item;
        })
    }

    return (
        <div className='widget'>
            {makeNodes(weatherInfo)}
        </div>
    )
};

export { makeWidget };
